INSERT INTO survey_player VALUES (49, 17, 0.00, 49, 33, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'Ich habe mir zuerst jene Auftrge angesehen, die den frhesten Liefertermin hatten. Diese habe ich dann freigegebe, damit keine Lager- bzw. Verzgerungskosten entstehen. Dadurch konnte ich leicht feststellen, welche Auftrge als erstes freigegeben werden mssen.', 'BHS (berufsbildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 4, 7, 7, 2, 3, 6, 1, 7, 1, 7, 7, 2, 7, 6, 3, NULL, 'Anfangs habe ich mich auf die durchschnittliche Systemzeit konzentriert. Dann war mir nicht klar, wie es bei der Auslieferung bzw. auch mit der Lagerung (es knnten fr ein paar Tage Kosten entstehen) im diesen System klapp. Nach anfnglichen Schwierigkeiten wusste ich aber, dass die Auftrge die demnchst den Auslieferungstermin hatte, als erstes freigegeben werden mssen,', 1, 1, 2, 7, 7, 7, 7, 'f', 'f', 'f', 't', 't', 2, 33, 33);
INSERT INTO survey_player VALUES (40, 8, 0.00, 40, 33, 1, 'f', 'f', NULL, '', 19, 'mnnlich', 'Ich habe immer jene Auftrge freigegeben, welche das frheste Flligkeitsdatum hatten. Dies habe ich das ganze Experiment entlang durchgezogen. Somit war die zentrale Information der Lieferzeitpunkt. Es gab keine unerwarteten berraschungen oder Schwierigkeiten.', 'AHS (allgemein bildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 6, 4, 6, 3, 4, 1, 1, 5, 3, 6, 4, 3, 4, 5, 4, NULL, 'Ich habe daran gezweifelt, dass die richtige Strategie so einfach sein kann. Der berblick der Kosten gab mir jedoch die entsprechende Sicherheit.', 1, 1, 1, 1, 0, 6, 7, 'f', 'f', 'f', 't', 't', 7, 33, 33);
