INSERT INTO survey_player VALUES (56, 1, 0.00, 56, 35, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'In der Vorbereitungsphase habe ich keine weitere Entscheidung getroffen, als jene die bereits angegeben waren. Anschlieend habe ich in jeder weiteren Durchfhrungsphase immer die Auftrge ausgewhlt, welche in den nchsten 10 Tagen fllig waren. So bin ich auf Kosten fr die Produktion und Lager auf 0.00 gekommen. Diese Taktik habe ich fr meine weiteren Durchfhrungsphasen immer so weiter beibehalten. 
