INSERT INTO survey_player VALUES (48, 16, 0.00, 48, 33, 1, 'f', 'f', NULL, '', 27, 'mnnlich', 'Es ist schwierig alle Auftrge simultan zu bearbeiten, da es notgedrungen zu Wartezyklen kommt. Ich habe versucht die Auftrge simultan zu bearbeiten in chronologischer Reihenfolge, was im Nachgang nicht die cleverste Idee zu sein scheint.', 'Universitt/Fachhochschule', 'Fakultt fr Betriebswirtschaft', 'Ja', 7, 5, 6, 5, 5, 2, 2, 5, 4, 5, 5, 2, 5, 5, 3, NULL, 'Es ist schwierig alle Auftrge simultan zu bearbeiten, da es notgedrungen zu Wartezyklen kommt. Ich habe versucht die Auftrge simultan zu bearbeiten in chronologischer Reihenfolge, was im Nachgang nicht die cleverste Idee zu sein scheint.', 4, 3, 6, 7, 5, 5, 2, 't', 't', 'f', 'f', 'f', 2, 33, 33);
