INSERT INTO survey_player VALUES (59, 4, 0.00, 59, 35, 1, 'f', 'f', NULL, '', 19, 'mnnlich', 'Ich habe einfach versucht so nahe am Termin zu sein wie es geht und versucht nicht zu spt zu liefern. Man muss dazu sagen ich habe die Aufgabe nicht 100% verstanden. Ich versuche jetzt einfach nur die 200 Ziffern irgendwie voll zu bekommen damit ich auf "weiter" klciken kann. Ich habe versucht die Lieferungen so zu planen, dass ich nicht zu spt liefere dass war mir das wichtigste und ich habe nicht genau verstanden was passiert wenn ich einen Auftrag nicht annehme.', 'AHS (allgemein bildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 7, 2, 3, 5, 5, 5, 5, 3, 6, 5, 2, 5, 5, 5, 5, NULL, 'Unsicherheiten gab es dann wenn der erste Auftrag erst in 30 Tagen war.', 5, 3, 6, 7, 7, 1, 2, 't', 't', 'f', 't', 't', 4, 35, 35);
