INSERT INTO survey_player VALUES (44, 12, 0.00, 44, 33, 1, 'f', 'f', NULL, '', 20, 'weiblich', 'Ich habe zunchst geschaut welche Auftrge in naher Zukunft erfllt werden mssen, anschlieend berlegt wie viele Auftrge ohne Kosten innerhalb dieser Zeit produziert werden knnen, in diesem Fall waren es 2. Dies hat bei allen Runden funktioniert, somit habe ich meine Logik whrend der Durchfhrungsphase nicht gendert.
INSERT INTO survey_player VALUES (47, 15, 0.00, 47, 33, 1, 'f', 'f', NULL, '', 25, 'weiblich', '1. Ich habe immer die zwei dringensten Auftge freigegeben um so weder einen Aufschlag fr Wartezeit noch fr Versptungen zahlen zu mssen. Auf Grund von Variation in der Produktionszeit habe ich diese Logik im Laufe der Durchfhrungsphase gendert. Ich habe mehr Auftrge freigegeben, weil dies gnstiger ist als Versptungen. 2. Die zentrale Information zur Freigabe war fr mich die durchschittliche Produktionszeit in Kombination mit dem Lieferdatum. 3. Eine berraschung war fr mich der bergang von Vorbereitungsphase zu Durchfhrungsphase. Dies sollte besser kenntlich gemacht werden. Irgendwann habe ich gesehen, dass ich bereits in der Durchfhrungsphase bin und war etwas berrascht. ', 'Universitt/Fachhochschule', 'Fakultt fr Volkswirtschaft und Statistik', 'Ja', 9, 5, 7, 3, 6, 2, 2, 6, 4, 7, 5, 3, 5, 6, 6, NULL, 'Die Produktionszeit hat variert. Ich habe mehr Auftrge freigegeben, weil dies gnstiger ist als Versptungen.', 1, 3, 3, 5, 5, 5, 7, 'f', 't', 't', 't', 't', 2, 33, 33);
